import React from 'react'
import PropTypes from 'prop-types';

const scale = {
    f: 'farheneit',
    c: 'celcius'
}

class Water extends React.Component {
    constructor (props) {
        super (props)
        this.state = { 
            scale: 'c',
            temperature : 20
        }
    }


    render () {
        return (<div>
            <TemperatureInput scale={scale.c} />
            <TemperatureInput scale={scale.f} />
        </div>
        )
    }
}

export default Water;
